import React from "react";

import Random from "./components/Random";
import Tag from "./components/Tag";
import User from "./components/User";

import "./App.css";

const App = () => (
  <div>
    <header>
      <div className="title">
        <p>Kelompok 15</p>
      </div>
      <div className="title navtext2">
        <p>Tugas Modul 4</p>
      </div>
    </header>
    <div className="main-container">
      <User />
    </div>
  </div>
);

export default App;
